import { StyleSheet } from 'react-native';

const styles = StyleSheet.create({
  rocket: {
    width: 50,
    height: 100,
    position: 'absolute',
  },
  satellite: {
    position: 'absolute',
  },
  planet: {
    width: 75,
    height: 50,
    position: 'absolute',
  },
  ufo: {
    width: 75,
    height: 50,
    position: 'absolute',
  },
  star: {
    position: 'absolute',
  },
});

export default styles;
